import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer-section">
      <div className="footer-section-container">
        <p>Website developed by <a href="https://www.linkedin.com/in/arbin-qazimi-mk98/" target='_blank' rel="noreferrer">Arbin Qazimi</a><span> &copy;</span></p>
      </div>
      <script src="https://apps.elfsight.com/p/platform.js" defer></script>
<div class="elfsight-app-a3dc5a49-08e1-42d3-89dc-829b4d32e176"></div>
    </footer>
  );
}

export default Footer;
